import React from "react";

const Work = () => {
  return (
    <div name="work" className="bg-[#0a2928] w-full md:h-screen text-gray-300">
      <div>
        <div>
          <p>Work</p>
          <p>// Check out some of my recent work</p>
        </div>
        <div>
          <div>
            <div>
              <span></span>
              <div>
                <a href="/">
                  <button></button>
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Work;
